import React, { Component } from 'react';
import { Route, NavLink } from 'react-router-dom';
import axios from 'axios';
import queryString from 'query-string';
import { List } from 'antd';

let interviews = null;
let  filteredInterviews = null;

class Interviews extends Component {

	componentWillMount() {
		axios.get('https://interview-corner-1de29.firebaseio.com/updated-interviews.json').
		then(response => 
			interviews = response.data);
	}

	componentDidMount() {
		axios.get('https://interview-corner-1de29.firebaseio.com/updated-interviews.json').
		then(response => 
			interviews = response.data);
		console.log(this.props.location.search);
		const values = queryString.parse(this.props.location.search);
		const selectedCollege = values.college;
		console.log('selectedCollege', selectedCollege);
		if(interviews) {
			filteredInterviews = Object.values(interviews).filter(
				(interview) => {
					return interview.college === selectedCollege;
				}
			);
			console.log(filteredInterviews);	
		}
	}

	render() {
		let data = null;
		if(interviews) {
			data = Object.values(interviews).map(
			(interview) => {
				return interview.name + " : " + interview.college
			});
			console.log(interviews);
		}
	    return (
			<div>
				<h3 style={{ margin: '16px 0' }}>Large Size</h3>
			    <List
			      size="large"
			      header={<div>Header</div>}
			      footer={<div>Footer</div>}
			      bordered
			      dataSource={data}
			      renderItem={item => (<List.Item>{item}</List.Item>)}/>
			</div>
    	);
	}
}

export default Interviews;
